import React, { useEffect, useState } from "react";
import AutoComplete from "../../components/autocomplete";
import axios from "axios";
import { urlApiMain } from "../../utils/url";

const Home = () => {
  const [userToTalk, setUserToTalk] = useState([]);
  const [listToTalk, setListToTalk] = useState([]);

  const letsMessageWithPeople = () => {
    axios
      .get(`${urlApiMain}letmessage`)
      .then((res) => {
        setUserToTalk(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  const getUsers = () => {
    userToTalk.map((user, index) => setListToTalk(user.name));
    console.log(listToTalk);
  };

  useEffect(() => {
    letsMessageWithPeople();
    getUsers();
  }, []);

  return (
    <div className="flex justify-center">
      <div className="bg-white md:w-1/2 mt-6 rounded shadow-lg">
        <div className="px-6 py-6">
          <input
            className="appearance-none block w-full bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-none focus:bg-white focus:border-gray-500"
            id="grid-last-name"
            type="text"
            placeholder="Search People...."
          />
          {userToTalk.map((user, index) => (
            <li>{user.name}</li>
          ))}
          <AutoComplete suggestions={listToTalk} />
          <p className="text-gray-700">
            Lorem ipsum dolor sit amet, consectetur adipisicing elit.
            Voluptatibus quia, nulla! Maiores et perferendis eaque,
            exercitationem praesentium nihil.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Home;
